  const [userName, setUserName] = useState('');
  const [users, setUsers] = useState(null);

  const getUsers = async (userName) => {
    await fetch(`https://api.github.com/search/users?q=${userName}`).then(res => console.log(res))
  }

  return (
    <div>
      <Header userName={userName} setUserName={setUserName} getUsers={getUsers} />
    </div>
  );
}

export default App;
